import React, { Component } from 'react';
import { Field, reduxForm } from 'redux-form';
// import CoffeeForm from './CoffeeForm';

class CreateCoffee extends Component {
	renderTextInput(formProps) {
		return (
			<input
				onChange={formProps.input.onChange}
				value={formProps.input.value}
			/>
		);
	}
	render() {
		return (
			<form>
				<Field name='name' component={this.renderTextInput} />
				<Field name='price' component={this.renderTextInput} />
				<Field name='description' component={this.renderTextInput} />
			</form>
		);
	}
}

export default reduxForm({ form: 'coffeeCreate' })(CreateCoffee);
